import { FaShoppingCart } from "react-icons/fa";

 const Navbar = () =>{ 
    return(
        <div>
            <div className="flex flex-row justify-between">
                <img src="https://pngimg.com/uploads/shopping_cart/shopping_cart_PNG38.png" alt="not found"> </img>
                <div>
                    <p>Home</p>
                    <FaShoppingCart />
                </div>
            </div>
        </div>
    )
};

export default Navbar;
